package main

import "fmt"

func isAnagram(s string, arr []int) bool {
    for _, v := range s {
        if arr[byte(v)-97] <= 0 {
            return false
        }
        arr[byte(v)-97]--
    }
    return true
}
func checkInclusion(s1 string, s2 string) bool {
    N, M := len(s1), len(s2)
    cntr1 := make([]int, 26)
    for _, v := range s1 {
        cntr1[byte(v)-97]++
    }
    cntr := make([]int, 26)
    for i := 0; i < M - N + 1; i++ {
        if cntr1[byte(s2[i])-97] > 0 {
            copy(cntr, cntr1)
            if isAnagram(s2[i:i+N], cntr) {
                return true
            }
        }
    }
    return false
}

func main() {
    data := [][]string {
                []string{"ab", "eidbaooo"},
                []string{"ab", "eidboaoo"},
                []string{"ab", ""},
                []string{"", ""},
                []string{"", ""},
                []string{"ab", "eidbaooo"},
                []string{"ab", "eidboaoo"},
                []string{"", ""},
                []string{"adc", "dcda"},
                []string{"", ""},
                []string{"", ""},
            }
    for _, v := range data {
        s1, s2 := v[0], v[1]
        //fmt.Printf("s1, s2 = %s, %s\n", s1, s2)
        fmt.Printf("len(s1), len(s2) = %d, %d\n", len(s1), len(s2))
        r := checkInclusion(s1, s2)
        fmt.Printf("r = %v\n", r)
        fmt.Println("=====================")
    }
}



